import * as React from 'react';
import { Paper, Card, CardContent } from '@mui/material';
import "./welcome.css"

export default function Welcome() {
  
  return (
    <>
    <div className='root'>
    <Typography variant="h5" component="h2" sx={{
          position: 'absolute',
          bottom: 0,
          left: 0,
          width: '100%',
          textAlign: 'start',
          paddingLeft: '20px',
        }}>
          {className}
        </Typography>
    </div>
    </>
  );
}
